import React from 'https://esm.sh/react@18.2.0';
import { ImageResponse } from 'https://deno.land/x/og_edge@0.0.6/mod.ts';

const font = fetch('https:/developer.mamezou-tech.com/fonts/KosugiMaru-Regular.ttf')
  .then((res) => res.arrayBuffer());
export default async function handler(request: Request) {
  const fontData = (await font);

  const url = new URL(request.url);
  if (!url.searchParams.has('title')) {
    console.log('no title...');
    return new Response('illegal og image url', { status: 400 });
  }
  const title = url.searchParams.get('title');
  const category = url.searchParams.get('category');

  try {
    return new ImageResponse(
      (<div
        style={{
          backgroundImage: 'url("data:image/png;base64,")',
          backgroundRepeat: 'no-repeat',
          fontFamily: 'Kosugi Maru',
          display: 'flex',
          height: '100%',
          width: '100%',
          flexDirection: 'column'
        }}
      >
        <div className="title" style={{
          margin: '250px 20px 20px 20px',
          color: '#4F4350',
          width: '96%',
          height: 'auto',
          fontSize: category ? 60 : 100,
          textAlign: 'center',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center'
        }}>
          <h1>{title}</h1>
        </div>
        {category && (
          <div className="category" style={{
            margin: '10px 20px 20px 20px',
            color: '#4F4350',
            display: 'flex',
            textAlign: 'center',
            fontSize: 30,
            flexDirection: 'column',
            alignItems: 'center'
          }}>
            {category ?? ''}
          </div>
        )}
      </div>),
      {
        width: 1200,
        height: 630,
        // Supported options: 'twemoji', 'blobmoji', 'noto', 'openmoji', 'fluent', 'fluentFlat'
        // Default to 'twemoji'
        emoji: 'twemoji',
        fonts: [{
          name: 'Kosugi Maru',
          data: fontData
        }]
      }
    );
  } catch (e) {
    console.log({ e });
    return new Response(`Failed to generate the image`, {
      status: 500
    });
  }
}
